import React, { Component } from "react";

class SingleBuyOrder extends Component {
	render() {
		return (
			<React.Fragment>
				{typeof this.props.buyOrdersArray[0] != "undefined"
					? this.props.buyOrdersArray.map((order) => {
							<p>{order.id}</p>;
					  })
					: "Loading"}
			</React.Fragment>
		);
	}
}

export default SingleBuyOrder;
